import React, { useState } from 'react';





function Home() {
    const [active, changeActive] = useState("NewNote");

    return(
    <div class="container">
        <header>
            <h1>Digital Diary</h1>
            <nav>
                    <a
                        href="#"
                        className={active === "Home" ? "active" : ""}
                        onClick={() => changeActive("Home")}
                    >
                        Home
                    </a>
                    <br/>
                    <a
                        href="#"
                        className={active === "NewNote" ? "active" : ""}
                        onClick={() => changeActive("NewNote")}
                    >
                        New Note
                    </a>
            </nav>
        </header>
    </div>
    )
}

export default Home;
